import React, { useEffect, useRef, useState } from "react";

const SMAChart: React.FC = () => {
  const containerRef = useRef<HTMLDivElement | null>(null);
  const chartRef = useRef<any>(null);
  const indicatorIdRef = useRef<string | null>(null);
  const kRef = useRef<any>(null);

  const [period, setPeriod] = useState(20);
  const [color, setColor] = useState("#FF9600");

  const buildDemoData = () => {
    const data: any[] = [];
    const now = Date.now();
    const oneMin = 60 * 1000;
    let lastClose = 100;
    for (let i = 0; i < 200; i++) {
      const ts = now - (200 - i) * oneMin;
      const open = lastClose;
      const drift = (Math.random() - 0.5) * 2;
      const close = Math.max(1, open + drift);
      const high = Math.max(open, close) + Math.random();
      const low = Math.min(open, close) - Math.random();
      const volume = 1000 + Math.floor(Math.random() * 200);
      lastClose = close;
      data.push({ timestamp: ts, open, high, low, close, volume });
    }
    return data;
  };

  const registerSMA = (klinecharts: any) => {
    try {
      klinecharts.registerIndicator({
        name: "MY_SMA",
        shortName: "SMA",
        series: "price", // draw on candle chart
        calcParams: [period],
        figures: [
          {
            key: "sma",
            title: "SMA",
            type: "line", // REQUIRED
          },
        ],
        calc: (dataList: any[], indicator: any) => {
          const p = Number(indicator.calcParams[0]) || 20;
          const result: any[] = [];
          let sum = 0;
          for (let i = 0; i < dataList.length; i++) {
            sum += dataList[i].close;
            if (i >= p) sum -= dataList[i - p].close;
            if (i >= p - 1) {
              result.push({ sma: sum / p });
            } else {
              result.push({});
            }
          }
          return result;
        },
        styles: {
          lines: [
            {
              key: "sma",
              color: "#FF9600",
              size: 2,
              style: "solid",
            },
          ],
        },
      });
    } catch {
      // ignore duplicate register
    }
  };

  useEffect(() => {
    let disposed = false;
    (async () => {
      const klinecharts = await import("klinecharts");
      kRef.current = klinecharts;
      if (!containerRef.current) return;

      const chart = klinecharts.init(containerRef.current);
      chartRef.current = chart;

      registerSMA(klinecharts);

      // attach SMA to candle pane
      const id = chart.createIndicator("MY_SMA", true, { id: "candle_pane" });
      indicatorIdRef.current = id;

      const data = buildDemoData();
      if (typeof chart.resetData === "function") {
        chart.resetData(data); // v10
      } else if (typeof chart.applyNewData === "function") {
        chart.applyNewData(data); // fallback v9
      }

      if (disposed) {
        klinecharts.dispose(chart);
      }
    })();

    return () => {
      disposed = true;
      const chart = chartRef.current;
      if (chart && kRef.current) {
        kRef.current.dispose(chart);
      }
    };
  }, []);

  // update period
  useEffect(() => {
    const chart = chartRef.current;
    if (!chart || !indicatorIdRef.current) return;
    chart.overrideIndicator({
      id: indicatorIdRef.current,
      calcParams: [period],
    });
  }, [period]);

  // update color
  useEffect(() => {
    const chart = chartRef.current;
    if (!chart || !indicatorIdRef.current) return;
    chart.overrideIndicator({
      id: indicatorIdRef.current,
      styles: { lines: [{ key: "sma", color }] },
    });
  }, [color]);

  return (
    <div style={{ width: "100%", height: "100%", display: "flex", flexDirection: "column", gap: 8 }}>
      <div style={{ display: "flex", gap: 12, padding: 8 }}>
        <label>
          Period:{" "}
          <input
            type="number"
            min={1}
            value={period}
            onChange={(e) => setPeriod(Number(e.target.value))}
          />
        </label>
        <label>
          Color:{" "}
          <input
            type="color"
            value={color}
            onChange={(e) => setColor(e.target.value)}
          />
        </label>
      </div>
      <div ref={containerRef} style={{ width: "100%", height: "520px" }} />
    </div>
  );
};

